import "./App.css";
import React, { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="App">
        <dvi className="search">
          <input type="text" />
        </dvi>
        <div className="display">
          <div className="city"></div>
          <div className="temp"></div>
          <div className="info"></div>
        </div>
      </div>
    );
  }
}

export default App;
